import React from 'react'

function Setting(props) { 
return (
    <div>
        <h1>Setting
            {
                props.inputList.map((x, i) => {
                    return (
                        <div key={i}>
                            <h1>{x.description}</h1>
                            <h1>{x.amount}</h1>
                            <h1>{x.month}</h1>
                        </div>
                    )
                })
            }
        </h1>
    </div>
)
}

export default Setting;
